import React from "react";
import Card from "../Card";
import "./DeleteModal.css";

function DeleteModal(selectedInvoiceID) {
  console.log(selectedInvoiceID);
  return (
    <div className="invoice-overlay">
      <div className="delete-invoice-card">
        <div className="delete-content">
          <p className="confirm-header">Confirm Deletion</p>
          <p>{`Are you sure you want to delete invoice #IOU${selectedInvoiceID.selectedInvoiceID}? This action cannot be undone.`}</p>
        </div>
      </div>
    </div>
  );
}

export default DeleteModal;
